import React from 'react'
import { Flex, Box, IconButton, useColorMode, Heading } from '@chakra-ui/react'
import { MoonIcon, SunIcon } from '@chakra-ui/icons'

const ThemeSelector = () => {
  const { colorMode, toggleColorMode } = useColorMode()
  return (
    <Box>
      <IconButton
        onClick={toggleColorMode}
        icon={colorMode === 'light' ? <SunIcon /> : <MoonIcon />}
        aria-label='Toggle System Color'
      />
    </Box>
  )
}

const SignInHeader = () => (
  <Box>
    <Heading>SignIn to new Account</Heading>
  </Box>
)

const SignIn = () => (
  <Flex>
    <Box>
      <ThemeSelector />
      <Box>
        <SignInHeader />
      </Box>
    </Box>
  </Flex>
)

export default SignIn
